document.addEventListener('DOMContentLoaded', function() {
    document.getElementById('imprimirBtn').addEventListener('click', function() {
        // Coleta os dados do formulário
        const nomeCliente = document.getElementById('nomeCliente').value;
        const numeroOS = document.getElementById('numeroOS').value;
        const modeloAparelho = document.getElementById('modeloAparelho').value;

        // Função para obter o valor selecionado ou 'Não informado' se nenhum for selecionado
        function getSelectedValue(name) {
            const selected = document.querySelector(`input[name="${name}"]:checked`);
            return selected ? selected.value : 'Não informado';
        }

        const aparelhoLiga = getSelectedValue('aparelhoLiga');
        const teclado = getSelectedValue('teclado');
        const tela = getSelectedValue('tela');
        const telaAvaria = getSelectedValue('telaAvaria');
        const carcaca = getSelectedValue('carcaca');
        const dobradiças = getSelectedValue('dobradiças');
        const carregador = getSelectedValue('carregador');
        const carregadorFunciona = getSelectedValue('carregadorFunciona');
        const bateria = getSelectedValue('bateria');
        const bateriaCarga = getSelectedValue('bateriaCarga');
        const outrosProblemas = document.getElementById('outrosProblemas').value || 'Nenhum';

        // Cria o PDF com jsPDF
        const { jsPDF } = window.jspdf;
        const doc = new jsPDF();

        // Adiciona a logo centralizada
        const logoImg = 'data:image/png;base64,'; // Substitua por sua imagem em Base64
        const imgWidth = 100; // Largura da imagem
        const imgHeight = 100; // Altura da imagem
        const pageWidth = doc.internal.pageSize.width; // Largura da página
        const x = (pageWidth - imgWidth) / 2; // Calcula a coordenada x para centralizar
        const y = -15; // Coordenada y onde a imagem será colocada

        doc.addImage(logoImg, 'PNG', x, y, imgWidth, imgHeight);
		
        // Adiciona as informações do cliente
		doc.setFontSize(22);
		doc.setFont('helvetica', 'bold'); // Define a fonte como negrito
		doc.text('Informações do Cliente', 60, 60);

		// Define as posições de x para cada coluna
		const xCol1 = 14;
		const xCol2 = 80; // Ajuste conforme necessário para deixar espaço suficiente
		const xCol3 = 150;
		
		doc.setFont('helvetica', 'normal'); // Define a fonte como normal
		doc.setFontSize(12);
		doc.text(`Nome do Cliente: ${nomeCliente}`, xCol1, 75);
		doc.text(`Número da OS: ${numeroOS}`, xCol3, 75);
		doc.text(`Modelo do Aparelho: ${modeloAparelho}`, xCol1, 85);

        // Adiciona a tabela com as perguntas e respostas
		doc.setFont('helvetica', 'bold'); // Define a fonte como negrito
        doc.setFontSize(14);
        doc.text('Estado do Aparelho:', 14, 100);
		
		doc.setFont('helvetica', 'normal'); // Define a fonte como normal
        doc.autoTable({
            startY: 105,
            head: [['Pergunta', 'Resposta']],
            body: [
                ['  1. Aparelho liga?', aparelhoLiga],
                ['  2. O teclado funciona?', teclado],
                ['  3. A tela funciona?', tela],
                ['  4. A tela possui avaria?', telaAvaria],
                ['  5. A carcaça está em boas condições?', carcaca],
                ['  6. As dobradiças estão quebradas?', dobradiças],
                ['  7. Possui carregador?', carregador],
                ['  8. O carregador funciona?', carregadorFunciona],
                ['  9. Possui bateria?', bateria],
                ['10. Bateria segura carga?', bateriaCarga],
                ['11. Outros problemas:', outrosProblemas]
            ],
            margin: { top: 105 },
            styles: { fontSize: 12 }
        });

        // Adiciona o disclaimer
        doc.setFontSize(12);
        doc.text('Autorização:', 14, doc.lastAutoTable.finalY + 15);
		doc.setFontSize(10);
        doc.text('Estou ciente do estado atual do meu aparelho e autorizo que ele seja submetido a testes pela Infomais.', 14, doc.lastAutoTable.finalY + 28);

        // Adiciona a linha para assinatura
        doc.text('Assinatura do Cliente:', 80, doc.lastAutoTable.finalY + 55);
        doc.line(14, doc.lastAutoTable.finalY + 50, 195, doc.lastAutoTable.finalY + 50);

        // Salva o PDF com um nome baseado no número da OS
        doc.save(`Cadastro_OS_${numeroOS}.pdf`);
    });
});
